INSERT INTO `article_metadata` VALUES (12526810,'How and when memory T cells form during an immune response are long-standing questions. To better understand memory CD8 T cell development, a time course of gene expression and functional changes in antigen-specific T cells during viral infection was evaluated. The expression of many genes continued to change after viral clearance in accordance with changes in CD8 T cell functional properties. Even though memory cell precursors were present at the peak of the immune response, these cells did not display hallmark functional traits of memory T cells. However, these cells gradually acquired the memory cell qualities of self-renewal and rapid recall to antigen suggesting the model that antigen-specific CD8 T cells progressively differentiate into memory cells following viral infection.','Kaech Susan M, Hemby Scott, Kersh Ellen, Ahmed Rafi','Molecular and functional profiling of memory CD8 T cell differentiation.'),(18275831,'Alterations in the stoichiometric balance between members of Bcl-2 and Fas apoptotic pathway could lead to the pathogenesis of systemic lupus erythematosus (SLE). We showed that patients with SLE displayed increased expression in antiapoptotic members of the Bcl-2 and Fas apoptotic pathways in isolated mononuclear cells. Further, mice (Bcl2l11(-/-)Fas(lpr/lpr)) lacking the Bcl-2 pro-apoptotic member, Bim (Bcl2l11(-/-)) and and with an lpr mutation in the gene encoding Fas (Fas(lpr/lpr)) developed severe SLE-like disease by 16 weeks of age unlike Bcl2l11(-/-) or Fas(lpr/lpr) mice. Bcl2l11(-/-)Fas(lpr/lpr) antigen-presenting cells (APCs) were markedly activated, and their numbers were increased in lymphoid tissues and in kidneys, yet numerous TUNEL-positive cells were observed in glomeruli of Bcl2l11(-/-)Fas(lpr/lpr) mice. These data demonstrate that dysregulation of the Bcl-2 or Fas pathways can alter the function of APCs, thereby leading to SLE pathogenesis.','Hutcheson Jack, Scatizzi John C, Siddiqui Akbar M, Haines G Kenneth, Wu Tianfu, Li Quan-Zhen, Davis Laurie S, Mohan Chandra, Perlman Harris','Combined deficiency of proapoptotic regulators Bim and Fas results in the early onset of systemic autoimmunity.'),(27851914,'Tumor-infiltrating regulatory T lymphocytes (Treg) can suppress effector T cells specific for tumor antigens. Deeper molecular definitions of tumor-infiltrating-lymphocytes could thus offer therapeutic opportunities. Transcriptomes of T helper 1 (Th1), Th17, and Treg cells infiltrating colorectal or non-small-cell lung cancers were compared to transcriptomes of the same subsets from normal tissues and validated at the single-cell level. We found that tumor-infiltrating Treg cells were highly suppressive, upregulated several immune-checkpoints, and expressed on the cell surfaces specific signature molecules such as interleukin-1 receptor 2 (IL1R2), programmed death (PD)-1 Ligand1, PD-1 Ligand2, and CCR8 chemokine, which were not previously described on Treg cells. Remarkably, high expression in whole-tumor samples of Treg cell signature genes, such as LAYN, MAGEH1, or CCR8, correlated with poor prognosis. Our findings provide insights into the molecular identity and functions of human tumor-infiltrating Treg cells and define potential targets for tumor immunotherapy.','De Simone Marco, Arrigoni Alberto, Rossetti Grazisa, Gruarin Paola, Ranzani Valeria, Politano Claudia, Bonnal Raoul J P, Provasi Elena, Sarnicola Maria Lucia, Panzeri Ilaria, Moro Monica, Crosti Mariacristina, Mazzara Saveria, Vaira Valentina, Bosari Silvano, Palleschi Alessandro, Santambrogio Luigi, Bovo Giorgio, Zucchini Nicola, Totis Mauro, Gianotti Luca, Cesana Giancarlo, Perego Roberto A, Maroni Nirvana, Pisani Ceretti Andrea, Opocher Enrico, De Francesco Raffaele, Geginat Jens, Stunnenberg Hendrik G, Abrignani Sergio, Pagani Massimiliano','Transcriptional Landscape of Human Tissue Lymphocytes Unveils Uniqueness of Tumor-Infiltrating T Regulatory Cells.');
/*!40000 ALTER TABLE `article_metadata` ENABLE KEYS */;
